import './App.css';

function App() {
  return (
    <div className="container">
      <h1 className="title">sad zeppelins</h1>
      <header>
        <ul>
          <li>PORTFOLIO</li>
          <li>BLOG</li>
          <li>CV</li>
          <li>STORE</li>
          <li>FREELANCE</li>
          <li>ABOUT ME</li>
          <li>CONTACT</li>
        </ul>
      </header>
      <div></div>
    </div>
  );
}

export default App;
